static int
test_lrupatnullkill(void){
	printf(" Verifying safe destruction of NULL lrupat...\n");
	destroy_lrupat(NULL);
	return 0;
}

static int
test_lrupatbasic(void){
	ustring u = USTRING_INITIALIZER;
	struct lrupat *lp;
	int ret = -1;

	printf(" Verifying basic lrupat operations...\n");
	if((lp = create_lrupat(NULL)) == NULL){
		goto done;
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	reset_ustring(&u);
	ret = 0;

done:
	destroy_lrupat(lp);
	return ret;
}

