static void
free_string(void *s){
	Free(s);
}

static int
test_lrupatadd(void){
	ustring u = USTRING_INITIALIZER;
	const char **input;
	struct lrupat *lp;
	int ret = -1;

	if((lp = create_lrupat(free_string)) == NULL){
		goto done;
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	reset_ustring(&u);
	printf(" Adding keys to lrupat...\n");
	for(input = LRUPAT_INPUT ; *input ; ++input){
		char *erp,*erpy;
		char *colon;

		if((erp = Strdup(*input)) == NULL){
			goto done;
		}
		if((colon = strchr(erp,':')) == NULL){
			fprintf(stderr," Bad input line: %s\n",erp);
			Free(erp);
			goto done;
		}
		*colon = '\0';
		if((erpy = Strdup(colon + 1)) == NULL){
			Free(erp);
			goto done;
		}
		if(add_lrupat(lp,erp,erpy)){
			fprintf(stderr," Failed adding %s:%s\n",erp,erpy);
			Free(erpy);
			Free(erp);
			goto done;
		}
		Free(erp);
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	reset_ustring(&u);
	ret = 0;

done:
	destroy_lrupat(lp);
	return ret;
}

static int
test_lrupatcheck(void){
	ustring u = USTRING_INITIALIZER;
	const char *LRUPAT_CHECKS[] = {
		"LRU", "LRUPAT 0", "LRUPAT 1",
		"TAPURL 2", "TAPURL 3", "TAP", NULL
	},**input;
	struct lrupat *lp;
	int ret = -1;

	if((lp = create_lrupat(free_string)) == NULL){
		goto done;
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	reset_ustring(&u);
	printf(" Adding keys to lrupat...\n");
	for(input = LRUPAT_CHECKS ; *input ; ++input){
		char *erp;

		if((erp = Strdup(*input)) == NULL){
			goto done;
		}
		if(add_lrupat(lp,*input,erp)){
			fprintf(stderr," Failed adding %s.\n",*input);
			Free(erp);
			goto done;
		}
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	for(input = LRUPAT_CHECKS ; *input ; ++input){
		void *r;

		if(lookup_lrupat(lp,*input,&r) == 0){
			fprintf(stderr," Couldn't find %s.\n",*input);
			goto done;
		}
		if(strcmp(r,*input)){
			fprintf(stderr," Invalid result for %s (%s).\n",*input,(const char *)r);
			goto done;
		}
	}
	reset_ustring(&u);
	ret = 0;

done:
	destroy_lrupat(lp);
	return ret;
}

static int
test_lrupatchecknocase(void){
	ustring u = USTRING_INITIALIZER;
	const char *LRUPAT_CHECKS[] = {
		"LRU", "LRUPAT 0", "LRUPAT 1",
		"TAPURL 2", "TAPURL 3", "TAP", NULL
	},**input;
	struct lrupat *lp;
	int ret = -1;

	if((lp = create_lrupat(free_string)) == NULL){
		goto done;
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	reset_ustring(&u);
	printf(" Adding keys to lrupat...\n");
	for(input = LRUPAT_CHECKS ; *input ; ++input){
		char *erp;

		if((erp = Strdup(*input)) == NULL){
			goto done;
		}
		if(add_lrupat_nocase(lp,*input,erp)){
			fprintf(stderr," Failed adding %s.\n",*input);
			Free(erp);
			goto done;
		}
	}
	if(stringize_lrupat(&u,lp)){
		goto done;
	}
	printf(" Stringized: %s\n",u.string);
	for(input = LRUPAT_CHECKS ; *input ; ++input){
		void *r;

		if(lookup_lrupat_nocase(lp,*input,&r) == 0){
			fprintf(stderr," Couldn't find %s.\n",*input);
			goto done;
		}
		if(strcmp(r,*input)){
			fprintf(stderr," Invalid result for %s (%s).\n",*input,(const char *)r);
			goto done;
		}
	}
	reset_ustring(&u);
	ret = 0;

done:
	destroy_lrupat(lp);
	return ret;
}

